import React from 'react';
import './Profile.css';  // Make sure you import the Profile CSS

function Profile() {
  return (
    <div className="profile-container">
      {/* Outer Purple Panel */}
      <div className="panel-purple">
        {/* Inner White Panels */}
        <div className="panel-white-left">
          <h2 className="panel-title">Profile Name</h2>
        </div>
        <div className="panel-white-right">
          <h2 className="panel-title">My Account</h2>
        </div>
      </div>
    </div>
  );
}

export default Profile;
